"Сбор информации и её объединение с ранее собранной информацией для выбора и доставки вам рекламных объявлений, а также для измерения эффективности доставки и результативности таких объявлений. Это включает в себя использование ранее собранной информации о ваших интересах для выбора рекламы, обработку данных о том, какая реклама, когда и где показывалась, и взаимодействовали ли вы каким-либо образом с рекламой, например кликали по ней или совершали покупку. К этому аспекту не относится персонализация, которая представляет собой сбор и обработку информации об использовании вами данного сервиса для персонализации рекламы и/или контента с течением времени на других ресурсах, например на других веб-сайтах или в приложениях."
